from math import isqrt
def a(n):
    if n<=2:
        return 0
    s=1
    l = [True] * n
    for i in range(3,isqrt(n)+1,2):
        if l[i]:
            l[i*i::2*i]=[False]*((n-i*i-1)//(2*i)+1)
    for i in range(3,n,2):
        if l[i]:
            s+=len(str(i))
    return s
